import React from 'react';
import SwiperCore, {
  Navigation,
  Pagination,
  Scrollbar,
  A11y,
  Autoplay,
} from 'swiper';

import { Swiper, SwiperSlide } from 'swiper/react';
// import useSticky from './../ hooks/useSticky.js'
import useSticky from './../../component/hooks/useSticky.js';
import { backGroundMain } from './data';
import Navbar from './../../component/Navbar/Navbar';
import 'swiper/swiper.scss';
import 'swiper/components/navigation/navigation.scss';
import 'swiper/components/pagination/pagination.scss';
import 'swiper/components/scrollbar/scrollbar.scss';

SwiperCore.use([Navigation, Pagination, Scrollbar, A11y]);

const Home = () => {
  const { isSticky, element } = useSticky();
  SwiperCore.use([Autoplay]);
  return (
    <div>
      <Navbar sticky={isSticky} />
      <main>
        <section className="welcome">
          <div ref={element}>
            <Swiper autoplay={{ delay: 5000 }}>
              {backGroundMain.map((value, index) => {
                return (
                  <SwiperSlide key={index}>
                    <div
                      style={{
                        height: '570px',
                        backgroundImage: `url(${value.image})`,
                        width: '100%',
                        backgroundRepeat: 'no-repeat',
                        backgroundPosition: 'center',
                        backgroundSize: 'cover',
                      }}
                    ></div>
                  </SwiperSlide>
                );
              })}
            </Swiper>
          </div>
        </section>
        <section className="home" style={{width: '100%',backgroundColor: '#FAFAFA'}}>
          <div style={{marginTop: '150px',width: '100%',display: 'flex',flexDirection: 'column',alignItems: 'center'}}>
              <span style={{fontWeight: 'bold',fontSize: '36px',marginBottom: '10px'}}>Be Aphrodite Everyday</span>
              <span style={{fontWeight: '300',fontSize: '18px',fontFamily: 'lato'}}>Show the world the true beauty of a true goddess </span>
          </div>
        </section>
      </main>
    </div>
  );
};

export default Home;
